    private void cb1PopupMenuWillBecomeInvisible(javax.swing.event.PopupMenuEvent evt) {//GEN-FIRST:event_cb1PopupMenuWillBecomeInvisible
        try {
            cb2.removeAllItems();
            Class.forName("com.mysql.cj.jdbc.Driver");
            Connection con = DriverManager.getConnection("jdbc:mysql://localhost:3306/project", "root", "16ani");
            PreparedStatement st = con.prepareStatement("SELECT Distinct Department_Name FROM university_info,bsc_courses where university_info.University_Name = bsc_courses.University_Name and Department_Name is Not Null and university_info.Country=?");
            st.setString(1, (String) cb1.getSelectedItem());
            ResultSet rs = st.executeQuery();
            while (rs.next()) {
                cb2.addItem(rs.getString("Department_Name"));
            }
            cb2.setSelectedIndex(-1);
        } catch (SQLException | ClassNotFoundException ex) {
            Logger.getLogger(Masters_clg.class.getName()).log(Level.SEVERE, null, ex);
        }
    }//GEN-LAST:event_cb1PopupMenuWillBecomeInvisible

